    false,nt"url": null,nt"notes": "This Sea-Level Affecting Marshes Model
    (SLAMM) report presents a model for projecting the effects of sea-level rise on
    coastal marshes and related habitats on Seatuck NWR.  The model is spatially explicit,
    using GIS technology to produce maps and tables that summarize the projected effects.
     The SLAMM simulations include five primary processes that affect wetland fate
    under different scenarios of sea-level rise including: inundation, erosion, overwash,
    saturation, and salinity.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
